import React from 'react';
import stationData from '../server/stationData';

export default function NavBar(props) {
    const { color } = props;
    const specificStations = stationData[color.toLowerCase()];

    return (
        <div className="navBar">
            <p id="navDesc">Select your starting station</p>
            <div className="listContainer">
                <ul className="stations">{specificStations.map((station, index) => {
                    <li id="station" key={index}>{station}</li>
                    if (index !== (specificStations.length - 1)) {
                        <li id="line">__________________________</li>
                    }
                })}
                </ul>
            </div>
        </div>
    );
}
